import React, { Component } from "react";

class Title extends Component {
  render() {
    return (
      <div
        className="page-header"
        style={{ color: "green", paddingBottom: "50px", textAlign: "center" }}
      >
        <h1>QUẢN LÝ USER</h1>
      </div>
    );
  }
}

export default Title;
